function WeatherTile(props) {
  let weather;
  if(props.today) {
    weather = <span>{props.today}</span>
  } else {
    weather = <span>{props.high} / {props.low}</span>
  }
  return(
    <div className="tile">
      <div className="weatherIco">
      <img icon={props.icon} alt='blak'/>
      </div>
        <span>{props.date}</span>
        {weather}
    </div>
  )
}

